/*!50003 CREATE*/ /*!50017 DEFINER=`root`@`localhost`*/ /*!50003 TRIGGER `dosFinales` BEFORE INSERT ON `Partido_Individual_Masculino` FOR EACH ROW BEGIN 
	
	DECLARE existe BOOL;

	SELECT COUNT(*) INTO existe
	FROM Partido_Individual_Masculino pim 
	WHERE pim.Año = NEW.Año AND 
	pim.ID_Torneo = NEW.ID_Torneo AND 
	pim.Ronda = 'F';

	IF (existe) THEN 
		SIGNAL SQLSTATE '45000' SET MESSAGE_TEXT = 'No pueden haber dos finales para un mismo torneo';
	END IF;
	
END */;;
