/*!50003 CREATE*/ /*!50017 DEFINER=`root`@`localhost`*/ /*!50003 TRIGGER `actualizarVictoriasYDerrotas` AFTER INSERT ON `Partido_Individual_Masculino` FOR EACH ROW BEGIN 
	
	UPDATE Rankings 
	SET victorias = victorias + 1
	WHERE ID_Jugador = NEW.ID_Jug_Ganador ;

	UPDATE Rankings 
	SET derrotas = derrotas + 1
	WHERE ID_Jugador = NEW.ID_Jug_Perdedor ;
	
END */;;
